import React from 'react';
import StadiumImage from "../assets/img/logo.png";
import styled from 'styled-components';

const BorderBlock = styled.div`
width: 85%;
height: 180px;

position: relative;
background: #FFFFFF;
border: 1px solid #000000;

margin: 0 auto;
padding-left: 50px;

margin-top: 32px;
display: flex;
align-items: center;
`

function Stadium({ name, address, image }) {    
  return (
    <div>
        <BorderBlock>
            <img src={image} alt="stadium image" />
            <h3>{name}</h3>
            <p>{address}</p>
        </BorderBlock>
    </div>
  );
}

const dummyData = [
  {
    name: "Stadium 1",
    address: "Address 1",
    image: {StadiumImage}
  },
  {
    name: "Stadium 2",
    address: "Address 2",
    image: {StadiumImage}
  },
];

function StadiumPage() {
  return (
    <div>
      {dummyData.map((data, index) => (
        <Stadium
          key={index}
          name={data.name}
          address={data.address}
          image={data.image}
        />
      ))}
    </div>
  );
}

export default StadiumPage;
